package com.wiley.gr.ace.authorservices.model.external;

/**
 * The Class SocietyElement.
 */
public class SocietyElement {

    /** The promocode. */
    private String promocode;

    /** The enddate. */
    private String enddate;

    /** The membershipno. */
    private String membershipno;

    /** The societyname. */
    private String societyname;

    /** The startdate. */
    private String startdate;

    /**
     * @return the promocode
     */
    public final String getPromocode() {
        return promocode;
    }

    /**
     * @param promocode
     *            the promocode to set
     */
    public final void setPromocode(final String promocode) {
        this.promocode = promocode;
    }

    /**
     * @return the enddate
     */
    public final String getEnddate() {
        return enddate;
    }

    /**
     * @param enddate
     *            the enddate to set
     */
    public final void setEnddate(final String enddate) {
        this.enddate = enddate;
    }

    /**
     * @return the membershipno
     */
    public final String getMembershipno() {
        return membershipno;
    }

    /**
     * @param membershipno
     *            the membershipno to set
     */
    public final void setMembershipno(final String membershipno) {
        this.membershipno = membershipno;
    }

    /**
     * @return the societyname
     */
    public final String getSocietyname() {
        return societyname;
    }

    /**
     * @param societyname
     *            the societyname to set
     */
    public final void setSocietyname(final String societyname) {
        this.societyname = societyname;
    }

    /**
     * @return the startdate
     */
    public final String getStartdate() {
        return startdate;
    }

    /**
     * @param startdate
     *            the startdate to set
     */
    public final void setStartdate(final String startdate) {
        this.startdate = startdate;
    }

}
